import React from 'react' ; 
function Social(){
    return (
        <ul className="bg-light container">
        <li>  <label for="box1" className="form-check-label bg-dark text-white"><input type="checkbox" name="box1" className = "form-check-input " /> Mohannad </label>  </li>
        <li> <label for="box2"  className="form-check-label bg-primary"><input type="checkbox" name="box2" className = "form-check-input" />Jalal</label> </li>
        <li> <label for="box3"  className="form-check-label bg-dark"><input type="checkbox" name="box3" className = "form-check-input" />jayousi</label> </li>

  </ul>
    );
}

export default Social ;
